import React from 'react';

const textItem=document.querySelector('.text_item');
const textBtn=document.querySelector('.text_btn');

textBtn.addEventListener('click',async ()=>{
    await AddText()
});

function AddText (){

    return fetch('https://baconipsum.com/api/?type=all-meat&paras=1&start-with-lorem=1',{
        paras:{
            "Content-type": "aplication/json; charset=UTF-8"
        }
    })
    .then(res => res.json())
        .then((text)=> console.log('text', paras))
}

export default AddText;
